import funding from '../images/icons/funding.svg';
import reagents from '../images/icons/reagents.svg';
import technologies from '../images/icons/technologies.svg';
import expertise from '../images/icons/expertise.svg';
import facilities from '../images/icons/facilities.svg';
import locationpin from '../images/icons/location_pin.svg';
import employee from '../images/icons/employee.svg';
import globe from '../images/icons/globe.svg';
import lightning from '../images/icons/lightning.svg';
import lightningBlue from '../images/icons/lightning-blue.svg';
import warning from '../images/icons/warning.svg';

const ICONS = {
  funding,
  compounds_reagents: reagents,
  tools_technologies: technologies,
  mentorship_expertise: expertise,
  lab_space: facilities,
  locationpin,
  employee,
  globe,
  lightning,
  lightningBlue,
  warning
};

export default ICONS;
